import React, {useState, createContext} from 'react'

const initialState = {
  barang : []
}

export const BarangContext = createContext(initialState);

export const  BarangProvider = ({children}) => {

    return (
        <BarangContext.Provider value={{barang : state.barang}}>
            {children}
        </BarangContext.Provider>
    );
};
